INSERT INTO `v1_9542ec3488ec1f0717b07c93d92e20f5db1778be9db99083330a728d7bc25090` VALUES (0.625, 11601, "ツムギのボトルキャップ", 1, 0.75, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 6);
